import React, { useEffect, useState } from "react";
import logo from "./logo.svg";
import "./App.css";
import * as THREE from "three";

const SPHERE_RADIUS = 1;
const SEGMENTS = 4;
const WIDTH = window.innerWidth / 1.5;
const HEIGHT = window.innerHeight;

const OrbitControls = require("three-orbit-controls")(THREE);

const setCamera = () => {
  const camera = new THREE.PerspectiveCamera(
    45,
    WIDTH / HEIGHT, // scene aspect ratio
    1, // camera will ignore objects closer than this
    1000 // camera will ignore objects father than this
  );
  camera.position.x = 0;
  camera.position.y = 6;
  camera.position.z = 6;
  camera.lookAt(new THREE.Vector3(0, 0, 0)); // camera wil look at this point

  return camera;
};

/* Update optimized for every browser's render (runs at 60fps)  */
function update(renderer: any, scene: any, camera: any, controls: any) {
  renderer.render(scene, camera);
  controls.update();

  var sphere = scene.getObjectByName("sphere");
  sphere.rotateY(0.01);

  // var light01: THREE.SpotLight = scene.getObjectByName("light01");
  // light01.intensity += (Math.random() - 0.5) * 0.15;
  // light01.intensity = Math.abs(light01.intensity);
  // light01.color = new THREE.Color(0xff0000);

  // var light02 = scene.getObjectByName("light02");
  // light02.intensity += (Math.random() - 0.5) * 0.05;
  // light02.intensity = Math.abs(light02.intensity);

  requestAnimationFrame(function() {
    update(renderer, scene, camera, controls);
  });
}

//////////////////// SPHERE SETUP //////////////////////////////////////////////
const getSphere = (radius: number) => {
  const geo = new THREE.SphereGeometry(radius, SEGMENTS, SEGMENTS);

  const material = new THREE.MeshBasicMaterial({
    color: 0x00ff00
  });

  var mesh = new THREE.Mesh(geo, material);
  mesh.position.y = (mesh.geometry as any).parameters.radius;
  mesh.name = "sphere";

  return mesh;
};

const updateSphereSegments = (
  sphere: THREE.Mesh,
  radius: number,
  segments: number
) => {
  const geometry = new THREE.SphereGeometry(radius, segments, segments);
  //
  sphere.geometry.dispose();
  sphere.geometry = geometry;
  sphere.name = "sphere";

  //
  return sphere;
};

const updateSphereMaterials = (
  sphere: THREE.Mesh,
  type: "basic" | "standard"
) => {
  const material =
    type === "basic"
      ? new THREE.MeshBasicMaterial({
          color: 0x00ff00
        })
      : new THREE.MeshStandardMaterial({
          color: 0xffffff
        });

  (sphere.material as THREE.Material).dispose();
  sphere.material = material;
  sphere.material.needsUpdate = true;

  return sphere;
};

const setSphereMaterials = (sphere: THREE.Mesh) => {
  const textureLoader = new THREE.TextureLoader();

  var metalTexture = textureLoader.load(getMetal());
  var sphereMaterial: any = sphere.material;
  sphereMaterial.bumpMap = metalTexture;
  sphereMaterial.roughnessMap = metalTexture;
  sphereMaterial.bumpScale = 0.01;
  sphereMaterial.roughness = 0.75;
  sphereMaterial.metalness = 0.25;

  sphereMaterial.needsUpdate = true;
  return sphere;
};

////////////////////////////////////////////////////////////////////////////////

//////////////////////////// FLOOR SETUP ///////////////////////////////////////
const getFloor = (w: number, h: number) => {
  var geo = new THREE.PlaneGeometry(w, h);
  var material = new THREE.MeshStandardMaterial({
    color: 0xffffff,
    side: THREE.DoubleSide
  });
  var mesh = new THREE.Mesh(geo, material);
  mesh.receiveShadow = true;
  mesh.name = "floor";

  return mesh;
};

const setFloorMaterials = (floor: THREE.Mesh) => {
  const textureLoader = new THREE.TextureLoader();

  const floorMaterial: any = floor.material;
  floorMaterial.roughness = 0.65;
  floorMaterial.metalness = 0.75;

  var texture = textureLoader.load(getTexture());
  // floorMaterial.map.dispose(); // a

  floorMaterial.map = texture;
  floorMaterial.needsUpdate = true;

  return floor;
  // floorMaterial.bumpScale = 0.01;
  // floorMaterial.bumpMap = texture;
  // floorMaterial.roughnessMap = texture;

  // var repetition = 6;
  // var textures = ["map", /*"bumpMap", "roughnessMap"*/]; // we will add 'bumpMap' and 'roughnessMap'
  // textures.forEach(mapName => {
  //   floorMaterial[mapName].wrapS = THREE.RepeatWrapping;
  //   floorMaterial[mapName].wrapT = THREE.RepeatWrapping;
  //   floorMaterial[mapName].repeat.set(repetition, repetition);
  // });
};

const setAdvancedFloorMaterials = (
  floor: THREE.Mesh,
  bgrepeat: number,
  bumpScale: number,
  roughness: boolean
) => {
  const textureLoader = new THREE.TextureLoader();

  const floorMaterial: any = floor.material;
  // var texture = textureLoader.load(getTexture());

  let textures = ["map"];

  if (bumpScale) {
    floorMaterial.bumpScale = bumpScale;
    floorMaterial.bumpMap = floorMaterial.map;
    textures = textures.concat(["bumpMap"]);
    floorMaterial.bumpMap.needsUpdate = true;
  }
  if (roughness) {
    floorMaterial.roughnessMap = floorMaterial.map;
    textures.concat(["roughnessMap"]);
    floorMaterial.roughnessMap.needsUpdate = true;
  }

  textures.forEach(mapName => {
    floorMaterial[mapName].wrapS = THREE.RepeatWrapping;
    floorMaterial[mapName].wrapT = THREE.RepeatWrapping;
    floorMaterial[mapName].repeat.set(bgrepeat, bgrepeat);
  });

  floorMaterial.needsUpdate = true;
  floorMaterial.map.needsUpdate = true;
  return floor;
};

////////////////////////////////////////////////////////////////////////////////

///////////////////////// LIGHTS SETUP /////////////////////////////////////////

function getSpotLight(color: number, intensity: number) {
  var light = new THREE.SpotLight(color, intensity);

  return light;
}

const init = () => {
  const scene = new THREE.Scene();
  const textureLoader = new THREE.TextureLoader();

  const camera = setCamera();

  // add objects to the scene
  var sphere = getSphere(SPHERE_RADIUS);
  scene.add(sphere);
  // setSphereMaterials(textureLoader, sphere);

  var floor = getFloor(50, 50);
  // setFloorMaterials( floor);

  scene.add(floor);
  floor.rotation.x = Math.PI / 2;

  const light01 = getSpotLight("rgb(145, 200, 255)" as any, 1);
  light01.position.x = 6;
  light01.position.y = 8;
  light01.position.z = -20;
  light01.castShadow = true;
  light01.shadow.mapSize.x = 4096;
  light01.shadow.mapSize.y = 4096;
  light01.name = "light01";
  scene.add(light01);

  const light02 = getSpotLight("rgb(255, 220, 180)" as any, 1);
  light02.position.x = -12;
  light02.position.y = 6;
  light02.position.z = -10;
  light02.castShadow = true;
  light02.shadow.mapSize.x = 4096;
  light02.shadow.mapSize.y = 4096;
  light02.name = "light02";
  scene.add(light02);

  var renderer = new THREE.WebGLRenderer();
  renderer.shadowMap.enabled = true;
  renderer.setSize(WIDTH, HEIGHT);

  var controls = new OrbitControls(camera, renderer.domElement);

  (document.getElementById("scene") as any).appendChild(renderer.domElement);
  update(renderer, scene, camera, controls);

  return scene;
};

const App: React.FC = () => {
  const [segments, setSegments] = useState(SEGMENTS);
  const [scene, setScene] = useState();
  const [hasShadows, setShadows] = useState(false);
  const [materialType, setMaterialType] = useState("basic");
  const [hasFloorTexture, setFloorTexture] = useState(false);
  const [repeat, setRepeat] = useState(1);
  const [bumpScale, setBumpScale] = useState(0);
  const [roughness, setRoughness] = useState(false);

  useEffect(() => {
    setScene(init());
  }, []);

  const onSegmentsChange = (event: any) => {
    const value = Number(event.target.value);
    if (value !== segments) {
      const sphere = scene.getObjectByName("sphere");
      scene.add(updateSphereSegments(sphere as any, 1, value));
      setSegments(value);
    }
  };

  const onMaterialChange = () => {
    const value = materialType === "basic" ? "standard" : "basic";
    const sphere = scene.getObjectByName("sphere");
    updateSphereMaterials(sphere, value);
    setMaterialType(value);
  };

  const onShadowChange = () => {
    const value = !hasShadows;
    const sphere = scene.getObjectByName("sphere");
    sphere.castShadow = value;
    sphere.receiveShadow = value;
    setShadows(value);
  };

  const onFloorTextureChange = () => {
    const value = !hasFloorTexture;
    if (value) {
      const floor = scene.getObjectByName("floor");
      setFloorMaterials(floor);
      // scene.add(setFloorMaterials(floor));
      setFloorTexture(value);
    }
    // scene.add(updateSphereShadows(sphere, value));
  };

  const onBGRepeatChange = (event: any) => {
    const value = Number(event.target.value);
    const floor = scene.getObjectByName("floor");
    setAdvancedFloorMaterials(floor, value, bumpScale, roughness);
    setRepeat(value);
  };

  const onBumpScaleChange = (event: any) => {
    const value = Number(event.target.value);
    const floor = scene.getObjectByName("floor");
    setAdvancedFloorMaterials(floor, repeat, value, roughness);
    setBumpScale(value);
  };

  const onRoughnessChange = () => {
    const value = !roughness;
    const floor = scene.getObjectByName("floor");
    setAdvancedFloorMaterials(floor, repeat, bumpScale, value);
    setRoughness(value);
  };

  const onSphereFill = () => {
    const sphere = scene.getObjectByName("sphere");
    setSphereMaterials(sphere);
  };

  return (
    <div className="App">
      <div className="scene" id="scene" />
      <div className="controls">
        1. That's not a %^*# Sphere :S <br />
        set sphere segments:{" "}
        <input
          type="number"
          value={segments}
          min={4}
          max={64}
          onChange={onSegmentsChange}
        />
        <hr />
        2. That's a circle, not a sphere :S<br />
        <input
          type="checkbox"
          checked={materialType === "standard"}
          onChange={onMaterialChange}
        />{" "}
        Enable Sphere Material
        <hr />
        3. Where are the shadows? :S<br />
        <input
          type="checkbox"
          checked={hasShadows}
          onChange={onShadowChange}
        />{" "}
        Enable Sphere Shadows
        <hr />
        4. floor texture? :S<br />
        <input
          type="checkbox"
          checked={hasFloorTexture}
          onChange={onFloorTextureChange}
          // disabled={hasFloorTexture}
        />{" "}
        Enable Floor Texture
        <hr />
        5. Fine, welcome to DOOM.EXE :S<br />
        Background Repeat:{" "}
        <input
          type="number"
          onChange={onBGRepeatChange}
          disabled={!hasFloorTexture}
          value={repeat}
          min={1}
          max={10}
          // disabled={hasFloorTexture}
        />{" "}
        <br />
        Bump Texture scale:{" "}
        <input
          type="number"
          onChange={onBumpScaleChange}
          disabled={!hasFloorTexture}
          value={bumpScale}
          min={0}
          max={5}
          step={0.1}
          // disabled={hasFloorTexture}
        />{" "}
        <br />
        <input
          type="checkbox"
          checked={roughness}
          onChange={onRoughnessChange}
          disabled={!hasFloorTexture}
        />{" "}
        Enable Floor Roughness
        <hr />
        6. Cool! let's{" "}
        <button onClick={onSphereFill}>do the same for the sphere</button>
      </div>
    </div>
  );
};

export default App;

